#pragma once

#include <cstdint>
#include <vector>

struct Vec2 {
    int32_t x;
    int32_t y;
};

struct Tensor2D {
    int32_t dim_x;
    int32_t dim_y;
    std::vector<double> vec;
    Tensor2D(int32_t dim_x, int32_t dim_y) : dim_x(dim_x), dim_y(dim_y) {
        vec.resize(dim_x * dim_y);
    }
    // at does NOT check the bounds
    inline double at(int32_t x, int32_t y) const {
        return vec[x * 8 + y];
    }
    inline void set(int32_t x, int32_t y, double value) {
        vec[x * 8 + y] = value;
    }
};

Tensor2D operator*(const Tensor2D& lhs, const Tensor2D& rhs);
Tensor2D operator+(const Tensor2D& lhs, const Tensor2D& rhs);
Tensor2D ReLU(const Tensor2D& tensor);

struct Linear {
    Tensor2D w;
    Tensor2D b;
    Linear(int32_t in_dim, int32_t out_dim) : w(in_dim, out_dim), b(1, out_dim) {}

    Tensor2D forward(const Tensor2D& x, bool use_relu = true) {
        if (use_relu) {
            return ReLU(x * w + b);
        } else {
            return x * w + b;
        }
    }
};

